class Data {  Data({      this.id,       this.nickName,       this.coins,       this.createdAt,       this.updatedAt,});  Data.fromJson(dynamic json) {    id = json['id'];    nickName = json['nick_name'];    coins = json['coins'];    createdAt = json['created_at'];    updatedAt = json['updated_at'];  }  int? id;  String? nickName;  int ?coins;  String? createdAt;  String ?updatedAt;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['nick_name'] = nickName;    map['coins'] = coins;    map['created_at'] = createdAt;    map['updated_at'] = updatedAt;    return map;  }}